import React from 'react';
import './nav.css';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";


function Nav(props) {
  return (
    <div class="navbar">
        <ul class="nav">
          <li>
            <a class="nav-link" Link to="/">Home</a>
          </li>
          <li>
            <a class="nav-link" Link to="/micros/">Microgreens</a>
          </li>
          <li>
            <a class="nav-link" Link to="/natives/">Native Plants</a>
          </li>
          <li>
            <a class="nav-link" Link to="/team/">Team</a>
          </li>
        </ul>
      </div>
  );
}

export default Nav;
